// 随机功能配置
const MUSICCONFIG = {
    // 时间间隔到最大随机范围的映射 [最大时间间隔(秒), 最大随机范围]
    timeToRangeMapping: [
        [0.2, 0],
        [0.6, 1],
        [1.0, 2],
        [1.4, 3],
        [2.0, 5],
        [Number.MAX_VALUE, 6]
    ],
    avoidSameLaneProbability: 0.8, // 非slide音符避免在同一轨道生成的概率
    defaultRange: 3 // 默认随机范围
};

// 音乐游戏状态管理
const musicState = {
    currentMusic: null,
    timepointMap: new Map(), // timepoint id到对象的映射
    slideMap: new Map(),     // slide id到对象的映射
    randomMap: new Map(),    // slide id到随机轨道的映射
    noteHistory: [],         // 已处理的音符历史，按时间排序
    lastNoteTime: 0          // 新增：存储最后一个节拍的时间
};

// ===== 主要事件处理函数 =====

// 播放谱面
Instance.OnScriptInput("Start", (inputData) => {
    const callerName = inputData.caller?.GetEntityName();
    if (!callerName) return;
    
    musicState.currentMusic = SearchMusic(musicList, callerName);
    
    if (!musicState.currentMusic) return;

    // 重置状态
    musicState.noteHistory = [];
    musicState.randomMap.clear();
    musicState.lastNoteTime = 0;

    ParseAndScheduleMusic(musicState.currentMusic);
});

// ===== 核心功能函数 =====

/**
 * 解析并安排谱面事件
 * @param {string} musicKey - 谱面标识
 */
function ParseAndScheduleMusic(musicKey) {
    const musicData = musicList[musicKey];
    if (!musicData) return;

    // 播放音乐
    Instance.EntFireAtName({ name: "music_" + musicKey.toLowerCase(), input: "StartSound", delay: 2.05 });

    // 计算总节拍数和全完美分数
    CalculateAndSetMusicStats(musicData);

    // 构建映射表
    musicState.timepointMap.clear();
    for (const tp of musicData.timepoints) {
        musicState.timepointMap.set(tp.id, tp);
    }

    musicState.slideMap.clear();
    for (const slide of musicData.slides) {
        musicState.slideMap.set(slide.id, slide);
    }

    // 计算所有音符的绝对时间并排序
    const notesWithTime = musicData.notes.map(note => {
        const timepoint = musicState.timepointMap.get(note.timepoint);
        if (!timepoint) return null;
        
        const beatOffset = note.offset / 48;
        const secondsPerBeat = 60 / timepoint.bpm;
        const noteTime = timepoint.time + beatOffset * secondsPerBeat;
        
        return { note, time: noteTime };
    }).filter(item => item !== null);
    
    // 按时间排序并处理
    notesWithTime.sort((a, b) => a.time - b.time);
    
    // 记录最后一个节拍的时间
    if (notesWithTime.length > 0) {
        musicState.lastNoteTime = notesWithTime[notesWithTime.length - 1].time;
        
        // 在最后一个节拍后5秒获取分数
        Instance.EntFireAtName({ 
            name: "music_game_score_counter", 
            input: "GetValue", 
            delay: musicState.lastNoteTime + 5 
        });
    }
    
    for (const item of notesWithTime) {
        ScheduleNote(item.note, item.time, musicData.random || false);
    }
}

/**
 * 计算并设置音乐统计信息
 * @param {Object} musicData - 音乐数据
 */
function CalculateAndSetMusicStats(musicData) {
    // 计算总节拍数（notes数组长度）
    const totalNotes = musicData.notes.length;
    
    // 计算全完美分数
    let allPerfectScore;
    if (totalNotes < 20) {
        allPerfectScore = totalNotes * 100;
    } else {
        allPerfectScore = 19 * 100 + (totalNotes - 19) * 110;
    }
    
    // 设置全连比较值
    Instance.EntFireAtName({ 
        name: "music_game_full_combo_compare", 
        input: "SetCompareValue", 
        value: totalNotes 
    });
    
    // 设置全完美比较值
    Instance.EntFireAtName({ 
        name: "music_game_all_perfect_compare", 
        input: "SetCompareValue", 
        value: allPerfectScore 
    });
}

/**
 * 安排音符生成事件
 * @param {Object} note - 音符数据
 * @param {number} noteTime - 音符的绝对时间
 * @param {boolean} useRandom - 是否使用随机功能
 */
function ScheduleNote(note, noteTime, useRandom) {
    // 计算轨道
    const lane = useRandom ? GetRandomLane(note, noteTime) : note.lane + 1;

    // 确定音符类型
    const noteType = GetNoteType(note);
    if (noteType === -1) return;

    // 安排音符生成
    Instance.EntFireAtName({
        name: `music_game_brick${noteType}_maker${lane}`,
        input: "ForceSpawn",
        delay: noteTime
    });

    // 更新历史记录
    if (useRandom) {
        musicState.noteHistory.push({ time: noteTime, lane });
    }
}

